import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div id="menu">
      <div class="menu-items">
        <Link to="/paint" class="menu-item">
          <h1>Paint</h1>
        </Link>
        <Link to="/settings" class="menu-item">
          Settings
        </Link>
        <Link to="/about" class="menu-item">
          About
        </Link>
        <Link to="/about" class="menu-item">
          Contact
        </Link>
      </div>
      <div id="menu-background"></div>
    </div>
  );
};

export default Home;
